import API from './api'
import { appConfigs } from './../configs'

const coreAPI = new API(appConfigs.getAPIUrl(appConfigs.apiDomain.auth))
export const userAPI = {
    login(userName, password) {
        let data = {
            userName: userName,
            password: password
        }
        return coreAPI.post('login', data)
    }
}
